        public void SetErrors()
        {
            errores = new List<List<string>>();
            for (int i = 0; i < matriz.GetLength(0); i++)
            {
                errores.Add(new List<string>());
                int m = matriz.GetLength(1);
                Console.Write("{0}: ", i);
                for (int j = 0; j < m - 49; j++)
                {
                    if (matriz[i, j] != "-1" && matriz[i, j] != " ")
                    {
                        string token = GetToken(j);
                        errores.Last().Add(token);
                        Console.Write("|{1}| ", i, token);
                    }
                }
                Console.WriteLine();
            }
