        public void PrintMatriz()
        {
            Console.WriteLine();
            for (int i = 0; i < matriz.GetLength(0); i++)
            {
                Console.Write("{");
                for (int j = 0; j < matriz.GetLength(1); j++)
                {
                    Console.Write(matriz.GetLength(1) - 1 == j ? "\"{0}\"" : "\"{0}\", ", matriz[i, j] == " " ? "-1" : matriz[i, j]);
                }
                Console.WriteLine("},");
            }
        }
